  \"2013-03-19T00:28:08.470055\",\n\t\"name\": \"surficial-geologic-map-of-the-tanana-b-1-quadrangle-central-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report provides detailed (1:63,360-scale)
  mapping of the Tanana B-1 Quadrangle (250 square miles; equivalent to four 7.5 minute
  quadrangles). The area is part of the Manley Hot Springs-Tofty mining districts
  and adjacent to the Rampart mining district to the north of the Tanana A-1 and A-2
  Quadrangles. This report includes detailed surficial geology, structural, stratigraphic,
  and geochronologic data. Based on the resulting geologic maps, field investigations,
  and laboratory materials analyses, the project has also generated derivative maps
  of geologic construction materials and geologic hazards.\",\n\t\"license_title\":
